import React from 'react';

const Edit = ({ singleuser }) => {

    return(
        <div>
            <div>
                <label> Username</label>
                <input id='newUsername' type='text' autoComplete={`${singleuser.name}`} />
            </div>
        </div>
    )
}

export default Edit;
